import React,{useState, useEffect} from 'react'
import { Button, Form, FormGroup, Label, Input } from 'reactstrap'

export default function ConsecutivoPage() {
    const url='http://127.0.0.1:3001/rol';
const initConsecutivo={
    CONS_TIPO:'',
    CONS_DESCRIPCION:'',
    CONS_VALOR:'',
    CONS_PREFIJO:'',
    
}
const [consecutivo, setConsecutivo]= useState(initConsecutivo);
const[roles,setRoles] = useState([]);
const [cargado,setCargado] = useState(false);

const traerDatos=async()=>{
  let datos = await fetch(url).then(resp=>resp.json());
  console.log('traerDatos::',datos);
  setRoles(datos);
  setCargado(!datos.length>0);
}
useEffect(()=>{
  traerDatos();
},[]);

const cambiarValor=(e)=>{
  const {name,value}=e.target;
  setRol({...rol,
  [name]:value});

 

}
  return (
    <div>
        <div className="card">
            <Form>
                <div className="card-header">
                    <h3>Consecutivos</h3>
                </div>
                <div className="card-body">
                    
                    <FormGroup>
                        <Label for="codigo">Codigo del Consecutivo</Label>
                        <Input 
                        type="text" 
                        name="codigo" 
                        id="codigo" 
                        placeholder="Digite el codigo del consecutivo" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="descripcion">Descripcion del Consecutivo</Label>
                        <Input 
                        type="text" 
                        name="descripcion" 
                        id="descripcion" 
                        placeholder="Digite el nombre " />
                    </FormGroup>
                    
                   
                   
                </div>
                <div className="card-footer">
                    <Button className='btn btn-success' >Aceptar</Button>
                    <Button className='btn btn-danger'>Cancelar</Button>
                    <Button className='btn btn-secondary' >Limpiar</Button>
                    <Button className='btn btn-success'>Refrescar</Button>
                    <Button className='btn btn-success'href="/menuSeguridad/consecutivo/agregar" >Agregar</Button>
                    <Button className='btn btn-danger'>Eliinar</Button>
                </div>

                
            </Form>
            <div className="card-header">
                    <h3>Lista de Consecutivos</h3>
                </div>
        </div>
    </div>
  )
}
